INSERT INTO `tasks` VALUES ('226', null, '', 'AppFrom的不允许录入字符控制存在漏洞', 'MAP304', '304', '3.0.4', '李国栋', '2013-11-14 14:43:01', '2013-11-15 00:00:00', '2013-11-19 00:00:00', '2013-11-15 18:10:35', '3', '问题：\n用户录入一个限制的特殊字符后,关闭弹出的提示框,然后点击页面的关闭按钮,页面弹出是否确定离开的确认框,这时点击取消,再点击保存按钮,不允许录入的字符就保存到数据库中了.\n需求：\n需要修复此控制漏洞,避免限制的字符能够正常保存.\n\n解决方法：\n尝试了三种方式，1.阻止窗口关闭事件执行；2.取消窗口关闭时focus之前的控件；3.保存form时再次验证。前两种方式均搞不定，最后采用第三种方式，在Submit的时候对form下所有text控件做forbiddenChars检测，检测不通过则不允许保存。', '产品', '', '0', '0', null, '2016-02-26 11:48:40', '2016-02-26 11:48:40');
