INSERT INTO `tasks` VALUES ('502', null, '', '上海红星登录页面缓慢问题原因', '上海红星地产', '256', '', '黄麟欢', '2014-02-23 15:47:21', '2014-01-02 00:00:00', '2014-01-02 18:00:00', '2014-02-23 15:48:15', '3', '客户反馈打开明源ERP系统非常缓慢。\n\n[解决方案]：\n1、访问Default.aspx页面，加载的确非常缓存，但登录ERP系统后，多次随机点击其他模块都非常快，不断刷新about.aspx页面，非常快、查看报表，速度都很正常。而每次访问default.aspx页面，都非常慢。说明服务器性能、网络、数据库都没有问题，而问题出现在default.aspx页面的后台；\n2、抓取慢时的w3wp.exe进程的dump文件，进行分析，可看到线程阻塞，阻塞发生在OADeskTop_DB页面调用软件狗部分。', '疑难', '', '0', '0', null, '2016-02-26 11:48:48', '2016-02-26 11:48:48');
INSERT INTO `tasks` VALUES ('503', null, '', '北京鑫苑下拉框空间加载缓慢', '北京鑫苑', '254', '', '吴开峰', '2014-02-23 15:49:48', '2014-01-03 00:00:00', '2014-01-05 00:00:00', '2014-02-23 15:50:31', '3', '下拉框加载控件慢的问题只在部分客户的电脑行存在该问题；\n\n[解决方案]：\n首先定位到为客户端问题（其他客户都是正常的）。\n于是禁用IE选项中的“启用第三方浏览器扩展”后问题解决。', '疑难', '', '0', '0', null, '2016-02-26 11:48:48', '2016-02-26 11:48:48');
INSERT INTO `tasks` VALUES ('504', null, '20140301-0001', '关于鑫苑消息服务多次自动停止问题紧急', '重庆鑫苑', '254', '', '吴开峰', '2014-02-23 15:57:42', '2014-02-19 00:00:00', '2014-03-07 00:00:00', '2014-03-01 11:09:29', '3', '[问题描述]：\n目前重庆鑫苑客户的正式服务器上部署的消息推送服务（待办推送，项目自己开发的服务程序），会偶尔出现自动停止运行的问题，对客户影响比较大，目前项目上对这块问题的排查缺乏经验，跟进过几次也没有结果，每次都是重新启动有好了。特申请专家协助分析一下客户环境，是什么原因导致;', '疑难', '', '0', '0', null, '2016-02-26 11:48:48', '2016-02-26 11:48:48');
