INSERT INTO `tasks` VALUES ('512', null, '20140219-0159', '雅居乐CRM系统Bug重复的订单记录', '中山雅居乐', '301', '', '薛小虎', '2014-02-24 18:11:03', '2014-02-19 00:00:00', '2014-02-21 00:00:00', '2014-02-24 19:55:48', '3', '业务用户按照正常的录入步骤，在销售系统上录入新的定单信息时，待客户点击保存信息后，系统生成了4条重复的激活定单信息，导致业务数据出错，严重影响用户的日常工作\n具体需求编号：（20140218-1100）\n\n[问题原因]\n根据IIS日志来看，这个认购单保存过多次导致了异常数据的产生。\n其中第1、2次保存是Order_edit.aspx，mode=1的页面中保存产生的，后面的两次是在mode=2的页面中产生的。\n从数据异常的角度上来看，2、3、4都是垃圾数据，通过保存前校验可以避免这种一房多卖的数据产生。 后', '疑难', '', '0', '0', null, '2016-02-26 11:48:48', '2016-02-26 11:48:48');
